import { Movie } from '../types/movie';
import { useState } from 'react';

function MovieList() {
  const [movieData, setMovieData] = useState<Movie[]>([]);
  return (
    <>
      <div className="row">
        <h4>Movies</h4>
      </div>
      <table>
        <thead>
          <tr>
            <th>Title</th>
            <th>Year</th>
            <th>Director</th>
            <th>Rating</th>
            <th>Category</th>
            <th>Edited</th>
          </tr>
        </thead>
        <tbody>
          {movieData.map((m) => (
            <tr key={m.MovieID}>
              <td>{m.Title}</td>
              <td>{m.Year}</td>
              <td>{m.Director}</td>
              <td>{m.Category}</td>
              <td>{m.Edited}</td>
            </tr>
          ))}
          ;
        </tbody>
      </table>
    </>
  );
}

export default MovieList;
